import React from 'react'
import Nav from '../Nav'
import {withRouter} from 'react-router'
import '../css/project.css'
import AllProjects from '../proj-data'


  class Projects extends React.Component{

    state={
      proj: AllProjects
    }

    projectClicked = (e) => {
      if(e.target.className === "blink"){
        this.props.history.push('/project/1')
      }
      else if(e.target.className === "sea"){
        this.props.history.push('/project/2')
      }
      else if(e.target.className === "lit"){
        this.props.history.push('/project/3')
      }
      else if(e.target.className === "boozer"){
        this.props.history.push('/project/4')
      }
    }

    clicked = (e) =>{
      this.state.proj.map((projObj) => {
        console.log(projObj, e.target.name)
        if(projObj.title === e.target.name){
          console.log(projObj.title)
        }
      })
    }


  render(){
    console.log(AllProjects)
    return(
      <div>
        <Nav />
        <div className="projects">
          <h1>Projects</h1>
          <div className="proj1">
            <div onClick={this.projectClicked, this.clicked} name='Blink' className="blink"></div>
            <p>JavaScript & Ruby on Rails</p>
          </div>
          <div className="proj1">
            <div onClick={this.projectClicked} name='Sea Learner' className="sea"></div>
            <p>React/Redux & Ruby on Rails</p>
          </div>
          <div className="proj1">
            <div onClick={this.projectClicked} name='NYC Event Manager (Lituation)' className="lit"></div>
            <p>Ruby & Ruby on Rails</p>
          </div>
          <div className="proj1">
            <div onClick={this.projectClicked} name='Boozer' className="boozer"></div>
            <p>Ruby on Rails & React</p>
          </div>
        </div>
      </div>
    )
  }
}
export default withRouter(Projects)
